description:
These are the recovery discs for a Compaq Presario CQ56. As you know you can only make 1 set of discs per computer, so here are the images for this particular one.

Burn the .iso images with burning software and label them. Now you have a fresh set. These are for a Windows 7 Home Premium X64 Bit operating system.	


